//AccountFriendStatueBarn
class FriendsInfo {
    uint64_t _addr;
    uint64_t _friendListAddr;
//    -- _addr + 0x170              friendsCount
//    -- _addr + 0x178              friendList friendClassSize:0x2C8
//    -- friendClass + 0            AcountId: size:0x10
//    -- friendClass + 0x20         name
//    -- friendClass + 0x2B0        点火
public:
    FriendsInfo *setAddr(uint64_t addr) {
        _addr = addr;
        _friendListAddr = _addr + 0x178;
        return this;
    }

    const char *getUUID(char *buff, int idx) {
        uint8_t *p = reinterpret_cast<uint8_t *>(_friendListAddr + 0x2C8 * idx);
        sprintf(buff, "%02x%02x%02x%02x-%02x%02x-%02x%02x-%02x%02x-%02x%02x%02x%02x%02x%02x", p[0],
                p[1], p[2], p[3], p[4],
                p[5], p[6], p[7], p[8], p[9], p[10], p[11], p[12], p[13], p[14], p[15]);
        return buff;
    }

    uint64_t getUUIDPtr(int idx) {
        return _friendListAddr + 0x2C8 * idx;
    }

    char *getNickName(int idx) {
        uint64_t nameAddr = _friendListAddr + 0x2C8 * idx + 0x20;
        if (*(uint8_t *) nameAddr & 1) {
            return *(char **) (nameAddr + 0x10);
        }
        return (char *) (nameAddr + 1);
    }

    int getFriendsCount() {
        return *(int *) (_addr + 0x170);
    }

    float *getFriendHeight(float *out, int idx) {
        out[0] = *(float *) (_friendListAddr + 0x2C8 * idx + 0x29C);
        out[1] = *(float *) (_friendListAddr + 0x2C8 * idx + 0x2A0);
        out[2] = 7.6f - 8.3f * out[0] - 3.0f * out[1];
        if (out[2] < 0.0f) {
            out[2] *= (-1.0f);
        }
        out[3] = 1.6f - 8.3f * out[0];
        if (out[3] < 0.0f) {
            out[3] *= (-1.0f);
        }
        out[4] = 7.6f - 8.3f * out[0] - 3.0f * (-2.0f);
        if (out[4] < 0.0f) {
            out[4] *= (-1.0f);
        }
        return out;
    }
};

